        Vanrise.GenericData.Business.GenericBusinessEntityManager _genericBEManager = new Vanrise.GenericData.Business.GenericBusinessEntityManager();
        Guid didBEDefinitionId = new Guid("60604af0-dd39-4162-93b3-063dec1ad6fc");
        public DIDEntityDetails GetDID(string didNumber)
        {
            var didEntity = GetDIDsByDID().GetRecord(didNumber);
            if (didEntity == null)
                return null;
            return DIDEntityDetailMapper(didEntity);

        }
        public List<DIDEntityDetails> GetDIDs(string category, string classification, string status)
        {
            var dids = GetAllDIDs();
            if (dids == null)
                return null;
            var statusDefinition = new Vanrise.Common.Business.StatusDefinitionManager().GetStatusDefinitionByName(status, new Guid("64871a68-c71a-4b1c-93b5-86842c21679d"));

            Func<DIDEntity, bool> filterExpression = (dIDEntity) => {
                if (category != null && dIDEntity.CategoryDescription != category)
                    return false;
                if (classification != null && dIDEntity.ClassificationDescription != classification)
                    return false;
                if (statusDefinition != null && dIDEntity.StatusId != statusDefinition.BusinessEntityDefinitionId)
                    return false;
                return true;
            };
            var filtered = dids.FindAllRecords(filterExpression);
            if (filtered == null)
                return null;
            return filtered.MapRecords(DIDEntityDetailMapper).ToList();
        }

        public OperationOutput ReserveNumber(ReserveInput input)
        {

            var didItem = GetDIDsByDID().GetRecord(input.DID);
            if (didItem != null && (didItem.StatusId == new Guid("4a88b6ab-1a56-4ce6-8431-ee4cad1a2bf1") || didItem.StatusId == new Guid("db355398-ea10-471c-a4ab-93e14ac6908e")))
            {
                var output = _genericBEManager.UpdateGenericBusinessEntity(new Vanrise.GenericData.Entities.GenericBusinessEntityToUpdate
                {
                    BusinessEntityDefinitionId = didBEDefinitionId,
                    FieldValues = new Dictionary<string, object> { { "AssignedTo", input.Customer } },
                    GenericBusinessEntityId = didItem.ID
                });
                if (output.Result == Vanrise.Entities.UpdateOperationResult.Succeeded)
                    return new OperationOutput { IsSucceeded = true };
            }
            return new OperationOutput { IsSucceeded = false };
        }

        public OperationOutput AssignNumber(AssignInput input)
