            var didItem = GetDIDsByDID().GetRecord(input.DID);
            if (didItem != null && (didItem.StatusId == new Guid("4a88b6ab-1a56-4ce6-8431-ee4cad1a2bf1") || didItem.StatusId == new Guid("db355398-ea10-471c-a4ab-93e14ac6908e") || didItem.StatusId == new Guid("432c41ec-eb46-49de-ac06-bb5ac31966d9")))
