        }

        private Dictionary<string, DIDEntity> GetDIDsByDID()
        {
            var allDIDs = GetAllDIDs();
            if (allDIDs == null)
                return null;
            return allDIDs.ToDictionary(x => x.DID, y => y);
        }
        public IEnumerable<DIDEntity> GetAllDIDs()
        {
            var allEntities = _genericBEManager.GetAllGenericBusinessEntities(didBEDefinitionId, new List<string> { "ID", "Category", "Status", "Classification", "CreatedBy", "CreatedTime", "AssignedTo", "DID", "LastModifiedBy", "LastModifiedTime", "CategoryDescription", "ClassificationDescription" });
            if (allEntities == null)
                return null;
            return allEntities.MapRecords(DIDEntityMapper);
        }
        private DIDEntity DIDEntityMapper(Vanrise.GenericData.Entities.GenericBusinessEntity genericBE)
        {
            return new DIDEntity
            {
                ID = (long)genericBE.FieldValues.GetRecord("ID"),
                CategoryId = (Guid)genericBE.FieldValues.GetRecord("Category"),
                StatusId = (Guid)genericBE.FieldValues.GetRecord("Status"),
                ClassificationId = (Guid)genericBE.FieldValues.GetRecord("Classification"),
                CreatedBy = (int)genericBE.FieldValues.GetRecord("CreatedBy"),
                CreatedTime = (DateTime)genericBE.FieldValues.GetRecord("CreatedTime"),
                Customer = genericBE.FieldValues.GetRecord("AssignedTo") as string,
                DID = genericBE.FieldValues.GetRecord("DID") as string,
                LastModifiedBy = (int)genericBE.FieldValues.GetRecord("LastModifiedBy"),
                LastModifiedTime = (DateTime)genericBE.FieldValues.GetRecord("LastModifiedTime"),
                CategoryDescription = genericBE.FieldValues.GetRecord("CategoryDescription") as string,
                ClassificationDescription = genericBE.FieldValues.GetRecord("ClassificationDescription") as string,
            };
        }

        private DIDEntityDetails DIDEntityDetailMapper(DIDEntity didEntity)
        {
